import { Link } from 'react-router-dom';

export default function NoPage() {
  return (
    <div
      className="container m-5"
      style={{
        textAlign: 'center', // Metni ortalar
        color: '#333', // Koyu gri metin rengi
        backgroundColor: '#f8f9fa', // Açık gri arka plan rengi
        padding: '20px', // İç boşluk
        borderRadius: '8px', // Köşe yuvarlama
        boxShadow: '0 4px 8px rgba(0, 0, 0, 0.1)' // Hafif gölge
      }}
    >
      <h1
        style={{
          fontSize: '2.5rem', // Başlık boyutu
          marginBottom: '20px' // Başlık ve altındaki alan arasındaki boşluk
        }}
      >
        The page you are looking for does not exist
      </h1>
      <h4
        style={{
          fontSize: '1.25rem', // Alt başlık boyutu
          marginTop: '20px' // Başlık ve üstündeki alan arasındaki boşluk
        }}
      >
        <Link
          to="/"
          style={{
            color: '#007bff', // Mavi renk bağlantı için
            textDecoration: 'none', // Altı çizili bağlantı metni
            fontWeight: 'bold' // Kalın metin
          }}
        >
          Take me back home
        </Link>
      </h4>
    </div>
  );
}
